import { defineMock } from 'vite-plugin-mock-dev-server'

// Mock data shape matching src/rpg.ts's Entity interface (loosely at runtime)
// Note: customData uses plain objects here since JSON can't carry Uint8Array

type EntityLike = { owner?: string }

const entities = [
    {
      id: 1,
      name: 'Aria Swiftwind',
      owner: 'player1',
      display: '',
      position: { x: 5, y: 0, z: 3 },
      rotation: 0,
      size: { x: 1, y: 2, z: 1 },
      stats: {
        HP: { id: 'HP', baseValue: 20, finalValue: 20 },
        DEX: { id: 'DEX', baseValue: 12, finalValue: 12 },
        STR: { id: 'STR', baseValue: 8, finalValue: 8 },
      },
      features: {
        NightVision: {
          feature: {
            name: 'Night Vision',
            description: 'See better in the dark.',
            iconName: 'moon'
          },
          enabled: true,
        },
      },
      entityType: 0, // EntityType.Creature
    },
    {
      id: 2,
      name: 'Training Dummy',
      position: { x: 10, y: 0, z: 6 },
      rotation: 90,
      size: { x: 1, y: 2, z: 1 },
      stats: {
        HP: { id: 'HP', baseValue: 50, finalValue: 50 },
      },
      features: {},
      entityType: 6, // EntityType.Prop
    },
]

export default defineMock({
  url: '/api/entities',
  // handle query filtering: /api/entities?owner=<username>
  response(req, res) {
    try {
      const url = new URL(req.url, 'http://localhost')
      const owner = url.searchParams.get('owner')
      const body = owner
        ? entities.filter((e) => ((e as EntityLike).owner ?? '').toLowerCase() === owner.toLowerCase())
        : entities
      res.setHeader('Content-Type', 'application/json')
      res.end(JSON.stringify(body))
    } catch (err) {
      res.statusCode = 500
      res.end(JSON.stringify({ message: 'Mock error', error: String(err) }))
    }
  },
})
